    [],nt"revision_timestamp": "2016-08-20T09:39:40.258825",nt"name": "proposal-legacy-seabird-monitoring-data-inventory-compilation-and-standardization",nt"isopen":
    false,nt"url": null,nt"notes": "Population data on seabirds are essential
    for conservation of those species, and are widely used as indicators of change in
    marine ecosystems. Alaska Maritime, Alaska Peninsula/Becharof, Kodiak, Togiak, and
    Yukon Delta National Wildlife Refuges have collected similar data on nesting seabird
    populations dating as far back as 1975. These data include a wide scope of monitoring
    surveys for a broad range of seabird species. Currently, the data are in disparate
    formats (electronic and paper) and multiple locations (local computers to filing
    cabinets). Standardized data across multiple entities is a key component for addressing
    landscape scale objectives.",nt"license_title": "License Not Specified",nt"extras":
